import logo from './logo.svg';
import './App.css';
import LoginPage from './pages/LoginPage';
import HomePage from './pages/HomePage';
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <LoginPage />
        </Route> 
      </Switch>
      <Switch>
        <Route path="/home" exact>
          <HomePage />
        </Route> 
      </Switch>
    </Router>
  );
}

export default App;
